package draken

import (
   "io"
   "net/http"
   "net/url"
   "strings"
)

func (poster) RequestUrl() (string, bool) {
   return "https://client-api.magine.com/api/playback/v1/widevine/license", true
}

func (poster) WrapRequest(b []byte) ([]byte, error) {
   return b, nil
}

func (poster) UnwrapResponse(b []byte) ([]byte, error) {
   return b, nil
}

func (a auth_login) license(play *playback) (*http.Response, error) {
   var req http.Request
   req.Header = make(http.Header)
   req.Method = "POST"
   req.ProtoMajor = 1
   req.ProtoMinor = 1
   req.URL = new(url.URL)
   req.URL.Host = "client-api.magine.com"
   req.URL.Path = "/api/playback/v1/widevine/license"
   req.URL.Scheme = "https"
   req.Body = io.NopCloser(license_body)
   magine_accesstoken.set(req.Header)
   req.Header["Authorization"] = []string{"Bearer " + a.v.Token}
   for key, value := range play.Headers {
      req.Header.Set(key, value)
   }
   return http.DefaultClient.Do(&req)
}

type poster struct {
   auth auth_login
   play playback
}

func (p poster) RequestHeader() (http.Header, error) {
   head := make(http.Header)
   magine_accesstoken.set(head)
   head.Set("authorization", "Bearer " + p.auth.v.Token)
   for key, value := range p.play.Headers {
      head.Set(key, value)
   }
   return head, nil
}

